import React from "react";
import withContext from "../withContext";

const Footer = props => {
    return (
        <>
            <div className="hero" style={{marginBlock:"1rem"}}>
                <div className="box">
                    <div className="columns">
                        <div class="column">
                            <b>Address</b>
                            <hr></hr>
                        </div>

                        <div class="column">2</div>

                        <div class="column">3</div>
                    </div>
                </div>
            </div>
        </>    
    );
}

export default withContext(Footer);
